import React, { Component } from "react";
import "./index.css";
export default class Item extends Component {
  render() {
    const { id, name, author, date } = this.props;
    return (
      <div>
        <div className="title-box">
          {id}.{name}
        </div>
        <div className="footer-bar">
          <span className = "">{author}</span>
          &nbsp;{date}
        </div>
      </div>
    );
  }
}
